import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';

export default function Searchhandle(){
    return (
          <div className='handle'>
          <div className='outer'>
          <input type="text" id="username" name="username"></input>
          <label for="username">Username</label>


            </div>
          </div>
    );
}
